INSERT INTO `notecommerce_db`.`products` (`prd_id`,`prd_title`,`prd_image_url`,`prd_price`,`prd_description`,`prd_brd_id`,`prd_processor`,`prd_graphics_card`,`prd_ram`,`prd_monitor`,`prd_hd`,`prd_ssd`,`prd_os`,`prd_deleted`) VALUES (1,'Notebook Lenovo Ideapad S145-15IWL Intel Core i5 - 8GB 1TB 15,6” Windows 10','data:image/jpeg;base64,',2399.1,'O notebook Lenovo S145-15IWL Ideapad S145 é compacto e sofisticado. A tela HD de 15.6\" é antirreflexo e as bordas ultrafinas do notebook permitem uma tela infinita, para você ter um notebook com design muito mais elegante. O modelo vem equipado com placa de Vídeo integrada Intel UHD Graphics 620, que resulta em mais agilidade e performance para a edição de fotos e vídeos. Desempenho de ponta com processador Intel Core i5-8265U; memória RAM de 8GB; capacidade do HD de 1TB, além do sistema operacional Windows 10 home assegura um notebook de alta tecnologia. Alto falantes com certificação Dolby Áudio garantem som alto e definido. Conte com o WiFi AC ultrarrápido para mais velocidade de navegação, e também com conexões como 02 USB 3.1, 01 USB 2.0, 01 Porta combo para Headset/Smartphone e 01 HDMI. ',1,'Intel Core i5','Intel UHD Graphics 620',8,'15.6',1,-1,'Windows',0);
INSERT INTO `notecommerce_db`.`products` (`prd_id`,`prd_title`,`prd_image_url`,`prd_price`,`prd_description`,`prd_brd_id`,`prd_processor`,`prd_graphics_card`,`prd_ram`,`prd_monitor`,`prd_hd`,`prd_ssd`,`prd_os`,`prd_deleted`) VALUES (3,'Notebook Essentials E30 Intel Core I3 4GB 1TB LED Full HD 15.6\'\' W10 - Samsung','data:image/jpeg;base64,',1899.04,'Notebooks versáteis, perfeitos para executar tarefas do dia a dia, fazer trabalhos escolares, navegar na internet e tudo mais que você e sua família quiser ou precisar.\r\n\r\nVocê pode substituir a memória e a capacidade de armazenamento do seu notebook, de forma prática e rápida! Mais espaço para suas fotos, vídeos e documentos, e mais agilidade para executar as tarefas.\r\n\r\nCom a tela de altíssima qualidade, seus trabalhos são exibidos com excelente definição de imagem e podem ser apreciados nos mínimos detalhes.\r\n\r\nHá assuntos que exigem um pouco mais de privacidade . Com um simples comando, deixe a imagem da sua tela escurecida ou semitransparente e tenha toda a liberdade de trabalhar nos seus documentos e informações confidenciais.\r\n\r\nÉ muito fácil bloquear a ativação da webcam e do microfone do seu notebook Essentials. Você pode desligar esses recursos tocando em apenas uma tecla e eles só serão habilitados novamente quando você quiser.\r\n\r\nA Samsung fabrica a maioria dos componentes dos notebooks. Isso significa que sua família receberá um aparelho com cada pedacinho testado exaustivamente para garantir a credibilidade que é marca registrada dos produtos Samsung.\r\n\r\nNada de dúvidas sem respostas e problemas sem soluções. Com o S-Service, você conversa com o suporte técnico especializado Samsung pelo computador2 ou telefone, em tempo real, na hora que precisar3.',7,'Intel® Core™ i3 7020U','Intel® HD Graphics 620 Integrada',4,'15.6',1,-1,'Windows',0);
